    order = ['', '#', '$', '%', '&', '*', '@', '^', '~']
    matcher = {}
    for nut in nuts:
        matcher[nut] = 1
    for bolt in bolts:
        if bolt in matcher:
            matcher[bolt] += 1
    matching_pairs = []
    for symbol in order:
        if matcher.get(symbol) == 2:
            matching_pairs.append(symbol)
    nuts.clear()
    nuts.extend(matching_pairs)
    bolts.clear()
